import React, { useEffect, useState } from 'react';
import { useAuth } from '../../context/AuthContext';
import { useCloud } from '../../context/CloudContext';
import { useNavigate, useSearchParams } from 'react-router-dom';
import CloudAccountCard from './CloudAccountCard';
import FileManager from '../files/FileManager';
import './Dashboard.css';

const Dashboard = () => {
  const { user, logout } = useAuth();
  const { cloudAccounts, fetchCloudAccounts, connectGoogleDrive, connectOneDrive } = useCloud();
  const navigate = useNavigate();
  const [searchParams] = useSearchParams();
  const [showSuccess, setShowSuccess] = useState(false);
  const [successMessage, setSuccessMessage] = useState('');

  useEffect(() => {
    // Check if returning from OAuth
    const connected = searchParams.get('connected');
    const error = searchParams.get('error');

    if (connected === 'google') {
      setSuccessMessage('Successfully connected to Google Drive!');
      setShowSuccess(true);
      fetchCloudAccounts();
      setTimeout(() => setShowSuccess(false), 5000);
    } else if (connected === 'onedrive') {
      setSuccessMessage('Successfully connected to OneDrive!');
      setShowSuccess(true);
      fetchCloudAccounts();
      setTimeout(() => setShowSuccess(false), 5000);
    }

    if (error) {
      alert('Error connecting to cloud: ' + error);
    }
  }, [searchParams, fetchCloudAccounts]);

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <div className="dashboard">
      <nav className="dashboard-nav">
        <h1>Multi-Cloud Storage</h1>
        <div className="user-info">
          <span>Welcome, {user?.username}!</span>
          <button onClick={handleLogout} className="btn-logout">
            Logout
          </button>
        </div>
      </nav>

      {showSuccess && (
        <div className="success-banner">
          ‚úì {successMessage}
        </div>
      )}

      <div className="dashboard-container">
        <aside className="sidebar">
          <div className="sidebar-section">
            <h3>Cloud Accounts</h3>

            <div className="connect-buttons">
              <button
                className="btn-connect-cloud google"
                onClick={connectGoogleDrive}
              >
                <span className="icon">üìÅ</span>
                Connect Google Drive
              </button>

              <button
                className="btn-connect-cloud onedrive"
                onClick={connectOneDrive}
              >
                <span className="icon">‚òÅÔ∏è</span>
                Connect OneDrive
              </button>
            </div>

            <div className="cloud-accounts-list">
              {cloudAccounts.length === 0 ? (
                <p className="no-accounts">No cloud accounts connected</p>
              ) : (
                cloudAccounts.map((account) => (
                  <CloudAccountCard key={account.id} account={account} />
                ))
              )}
            </div>
          </div>
        </aside>

        <main className="main-content">
          {cloudAccounts.length > 0 ? (
            <FileManager />
          ) : (
            <div className="empty-state">
              <h2>Welcome to Multi-Cloud Storage!</h2>
              <p>Connect your cloud accounts to get started.</p>
              <div className="empty-state-buttons">
                <button
                  className="btn-primary"
                  onClick={connectGoogleDrive}
                >
                  üìÅ Connect Google Drive
                </button>
                <button
                  className="btn-primary onedrive-btn"
                  onClick={connectOneDrive}
                >
                  ‚òÅÔ∏è Connect OneDrive
                </button>
              </div>
            </div>
          )}
        </main>
      </div>
    </div>
  );
};

export default Dashboard;
